__NUXT_JSONP__("/organisations", (function(a,b,c,d,e,f,g,h){return {data:[{organisations:[{_id:b,name:"Earth 2.0",field:"Climate Research",needs:"Web Developer, Community Organiser",img_url:"https:\u002F\u002Fres.cloudinary.com\u002Fsubguy\u002Fimage\u002Fupload\u002Fc_scale,q_60,r_0,w_200\u002Fv1602077350\u002Fleft-together\u002Fearth_km77bc.png",published_at:"2020-10-18T12:59:18.505Z",createdAt:"2020-10-18T12:59:01.373Z",updatedAt:"2020-10-19T17:09:07.377Z",__v:a,message:"Founded in 2016 as part of the GNDE intiative we focus on scientic research to fuel the climate debate. We are 100% funded by donations. We need a Junior Web Developer to help our in-house developer performing daily routine task. We are also looking for experienced community organiser to build an on- and offline base of mission evangelists.",id:b},{_id:c,name:"My Honey",field:"Biodiversity",needs:"Junior Campaigner, Campaign Lead",img_url:"https:\u002F\u002Fres.cloudinary.com\u002Fsubguy\u002Fimage\u002Fupload\u002Fc_scale,q_60,w_200\u002Fv1602077372\u002Fleft-together\u002Fhexa_xgerbr.png",published_at:"2020-10-18T13:26:16.884Z",createdAt:"2020-10-18T13:00:52.501Z",updatedAt:"2020-10-20T12:15:01.435Z",__v:a,message:"Honey is tasty. But we can't afford to consume produce made from monocultures. Our Start-Up is dedicated to bring back diversity into agricultural production. All bees are queens!\nWe need a Junior Campaigner and a Campaign Lead to ensure sustainable funding, communicate with our community and to fight the EU agrar-lobby.",id:c},{_id:d,name:"Edisonify",field:"Microcredit Hub",needs:"Junior Developer Ruby\u002FJavaScript",img_url:"https:\u002F\u002Fres.cloudinary.com\u002Fsubguy\u002Fimage\u002Fupload\u002Fc_scale,q_60,w_200\u002Fv1602077372\u002Fleft-together\u002Fideaa_fmvaev.png",published_at:"2020-10-18T13:26:28.861Z",createdAt:"2020-10-18T13:02:07.725Z",updatedAt:"2020-10-20T12:20:28.803Z",__v:a,message:"Not everyone is entitled to big banking loans. We have developed a blockchain driven secure and lean microcrediting platform. Wanna help organic farms grow? Then check out our micro fonds.\nTo support our development team we need a Junior Developer that commands Ruby on Rails and modern JS frameworks.",id:d},{_id:e,name:"Renewable Me",field:"Renewable Energy Research",needs:"Ecology Students, Renewable Energy Students",img_url:"https:\u002F\u002Fres.cloudinary.com\u002Fsubguy\u002Fimage\u002Fupload\u002Fc_scale,q_60,w_200\u002Fv1602077372\u002Fleft-together\u002Fsolaytic_xraz6c.png",published_at:"2020-10-18T13:28:02.237Z",createdAt:"2020-10-18T13:27:57.427Z",updatedAt:"2020-10-21T13:03:16.439Z",__v:a,message:"There is no Planet B! That's a catchy phrase but if you really think about it, it sums up where we as an organisation stand. The time for fossil ressources is over and we are working hard to provide valuable open-access research data to the community.\nWe need students of all relevant areas to help us perform polls and to design questionnaires. Make your internship or volunteer working hours count!",id:e},{_id:f,name:"DeCarbonize",field:"Carbon Compensation",needs:"Fullstack Developer",img_url:"https:\u002F\u002Fres.cloudinary.com\u002Fsubguy\u002Fimage\u002Fupload\u002Fc_scale,q_60,w_200\u002Fv1602077372\u002Fleft-together\u002Ftreva_pwsmnu.png",published_at:"2020-10-18T13:30:00.934Z",createdAt:"2020-10-18T13:29:56.340Z",updatedAt:"2020-10-21T13:07:35.595Z",__v:a,message:"Boat tours, shopping trips to London and individual car commuting is a luxury we can't afford as a society. But sometimes it is unavoidable. We can help you reduce your carbon footprints by calculating your stats and offer you small and sustainable projects to help you zerofying your footprint.\nWe need a Frontend\u002FBackend Developer to manage our growing user base. We pay 65% market salary, but we'll provide an exceptional team and a dedicated mission.",id:f},{_id:g,name:"Better Stream",field:"Social Streaming Provider",needs:"Office Intern",img_url:"https:\u002F\u002Fres.cloudinary.com\u002Fsubguy\u002Fimage\u002Fupload\u002Fc_scale,q_60,w_200\u002Fv1602077372\u002Fleft-together\u002Ftvit_t6uo7a.png",published_at:"2020-10-18T13:30:55.058Z",createdAt:"2020-10-18T13:30:45.919Z",updatedAt:"2020-10-21T13:10:43.448Z",__v:a,message:"Better Stream is a platform for sustainable streaming. We source free documentaries, podcasts, films and series from public databases and offer a curate streaming experience.\nFor our Berlin office we are looking for an office intern that helps us in our daily workload. We offer: Free lunch, free coffee and glimpse into a brand new start-up.",id:g},{_id:h,img_url:"https:\u002F\u002Fres.cloudinary.com\u002Fsubguy\u002Fimage\u002Fupload\u002Fc_scale,q_68,w_500\u002Fv1603038370\u002Fleft-together\u002FWizardry_rsiw1h.png",name:"Wizardry",field:"Food Bank",needs:"Food Distributors, Drivers",published_at:"2020-10-18T16:18:15.762Z",createdAt:"2020-10-18T16:18:11.257Z",updatedAt:"2020-11-04T10:59:32.185Z",__v:a,message:"We are a next level, app-based food bank. Hungry? Come to one of our 120 hubs and talk to us. We have daily deliveries from dozens of supermarkets, bakeries and delis.\nWe are always searching for volunteers that distribute the product. Help fight world hunger! #foodforall",id:h}]}],fetch:[],mutations:[]}}(0,"5f8c3c15f4aaf0153296b403","5f8c3c84f4aaf0153296b404","5f8c3ccff4aaf0153296b405","5f8c42dd8ef442001747818b","5f8c43548ef442001747818c","5f8c43858ef442001747818d","5f8c6ac3ccb8530017f9a7a1")));